import React from "react";
import Card from "../card/Card-component";

const Cardlist = ({ neighbors }) => {
  return neighbors.map((neighbor, i) => {
    return (
      <Card key={neighbor.id} name={neighbor.name} email={neighbor.email} />
    );
  });
};

export default Cardlist;
